import React from "react";
import {NavLink} from "react-router-dom";

const Menu = () => { 
    return(
        <>
        <NavLink activeClassName="Linkhover" to="./">Home</NavLink>
        <NavLink activeClassName="Linkhover" to="./App">Note</NavLink>
        <NavLink activeClassName="Linkhover" to="./services">Services</NavLink>
        <NavLink activeClassName="Linkhover" to="./contact">Contact</NavLink>
        </>
    );
};
export default Menu;
